import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';

export default function NovoDono() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '', cpf: '', endereco: '', telefone: '', email: '',
    dataNascimento: '', responsavel: false, ativo: true, observacoes: ''
  });

  const handleChange = e => {
    const { name, value, type, checked } = e.target;
    setForm(f => ({ ...f, [name]: type === 'checkbox' ? checked : value }));
  };

  const handleSubmit = async e => {
    e.preventDefault();
    await api.post('/donos', form);
    navigate('/donos');
  };

  return (
    <div className="container my-4">
      <div className="p-4 border rounded shadow-sm bg-white">
        <div className="d-flex justify-content-between align-items-center mb-4">
          <h2>Cadastrar Novo Dono</h2>
          <div>
            <Link to="/" className="btn btn-secondary me-2">← Voltar ao Início</Link>
            <Link to="/donos" className="btn btn-dark">Ver Donos</Link>
          </div>
        </div>

        <form onSubmit={handleSubmit}>
          <div className="mb-3"><label className="form-label">Nome</label>
            <input name="nome" className="form-control" value={form.nome} onChange={handleChange} required />
          </div>
          <div className="mb-3"><label className="form-label">CPF</label>
            <input name="cpf" className="form-control" value={form.cpf} onChange={handleChange} required />
          </div>
          <div className="mb-3"><label className="form-label">Endereço</label>
            <input name="endereco" className="form-control" value={form.endereco} onChange={handleChange} required />
          </div>
          <div className="mb-3"><label className="form-label">Telefone</label>
            <input name="telefone" className="form-control" value={form.telefone} onChange={handleChange} />
          </div>
          <div className="mb-3"><label className="form-label">Email</label>
            <input name="email" type="email" className="form-control" value={form.email} onChange={handleChange} />
          </div>
          <div className="mb-3"><label className="form-label">Data de Nascimento</label>
            <input name="dataNascimento" type="date" className="form-control" value={form.dataNascimento} onChange={handleChange} />
          </div>
          <div className="form-check mb-2">
            <input type="checkbox" className="form-check-input" name="responsavel" checked={form.responsavel} onChange={handleChange} />
            <label className="form-check-label">Responsável</label>
          </div>
          <div className="form-check mb-3">
            <input type="checkbox" className="form-check-input" name="ativo" checked={form.ativo} onChange={handleChange} />
            <label className="form-check-label">Ativo</label>
          </div>
          <div className="mb-3"><label className="form-label">Observações</label>
            <textarea name="observacoes" className="form-control" rows="2" value={form.observacoes} onChange={handleChange} />
          </div>
          <button type="submit" className="btn btn-success">Cadastrar Dono</button>
        </form>
      </div>
    </div>
  );
}
